"use client";

import { useState } from "react";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

// Replace this with your actual logoBase64 string
    const logoBase64 = "data:image/png;base64,"; // replace with your logo

export default function InvoicePage() {
  const [order, setOrder] = useState({
    orderId: "",
    name: "",
    address: "",
    phone: "",
    totalBill: "",
    paymentMode: "",
    poNumber: "",
  });

  const [items, setItems] = useState([{ description: "", quantity: 1, rate: 0 }]);

  const [charges, setCharges] = useState([
    { label: "Delivery", amount: 0 },
    { label: "Discount", amount: 0 },
  ]);

  const handleOrderChange = (e) => {
    setOrder({ ...order, [e.target.name]: e.target.value });
  };

  const handleItemChange = (i, e) => {
    const newItems = [...items];
    newItems[i][e.target.name] = e.target.value;
    setItems(newItems);
  };

  const addItem = () => setItems([...items, { description: "", quantity: 1, rate: 0 }]);
  const removeItem = (i) => setItems(items.filter((_, idx) => idx !== i));

  const handleChargeChange = (i, e) => {
    const newCharges = [...charges];
    newCharges[i][e.target.name] = e.target.value;
    setCharges(newCharges);
  };

  const addCharge = () => setCharges([...charges, { label: "", amount: 0 }]);
  const removeCharge = (i) => {
    const label = charges[i].label.toLowerCase();
    if (["delivery", "discount"].includes(label)) return;
    setCharges(charges.filter((_, idx) => idx !== i));
  };

  const itemsTotal = items.reduce(
    (sum, item) => sum + Number(item.quantity) * Number(item.rate),
    0
  );

  const deliveryCharge = Number(
    charges.find((c) => c.label.toLowerCase() === "delivery")?.amount || 0
  );

  const discountAmount = Number(
    charges.find((c) => c.label.toLowerCase() === "discount")?.amount || 0
  );

  const otherCharges = charges.filter(
    (c) => !["delivery", "discount"].includes(c.label.toLowerCase())
  );

  const otherChargesTotal = otherCharges.reduce(
    (sum, c) => sum + Number(c.amount || 0),
    0
  );

  const finalTotal = itemsTotal + deliveryCharge + otherChargesTotal - discountAmount;

  const capitalizeWords = (str) =>
    str.replace(/\w\S*/g, (txt) => txt.charAt(0).toUpperCase() + txt.slice(1).toLowerCase());

  const generatePDF = () => {
    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();
    const leftX = 14;
    const rightX = pageWidth - 14;

    // Header
    const logoWidth = 12;
    const logoHeight = 12;
    doc.addImage(logoBase64, "PNG", leftX, 12, logoWidth, logoHeight);
    doc.setFontSize(16);
    doc.setFont(undefined, "bold");
    doc.text("Habitus", leftX + logoWidth + 4, 20);
    doc.text("Order Invoice", rightX, 20, { align: "right" });

    doc.setFontSize(12);
    doc.setFont(undefined, "normal");
    doc.text(`Order ID: ${order.orderId}`, leftX, 30);
    doc.text(`Name: ${order.name}`, leftX, 38);
    doc.text(`Address: ${order.address}`, leftX, 46);
    doc.text(`Phone: ${order.phone}`, leftX, 54);
    doc.text(`Total Bill: Rs  ${finalTotal.toFixed(2)}`, rightX, 30, { align: "right" });
    doc.text(`Payment Mode: ${order.paymentMode}`, rightX, 38, { align: "right" });
    doc.text(`PO Number: ${order.poNumber}`, rightX, 46, { align: "right" });

    autoTable(doc, {
      head: [["#", "Description", "Quantity (No./Grams)", "Rate (Rs)", "Total (Rs)"]],
      startY: 65,
      body: items.map((item, idx) => [
        idx + 1,
        capitalizeWords(item.description),
        item.quantity,
        Number(item.rate).toFixed(2),
        (item.quantity * item.rate).toFixed(2),
      ]),
      theme: "grid",
      headStyles: {
        fillColor: [0, 0, 0],
        textColor: [255, 255, 255],
        halign: "center",
      },
      styles: { fontSize: 11 },
      margin: { left: 14, right: 14 },
      columnStyles: {
        3: { halign: "right" },
        4: { halign: "right" },
      },
    });

    let y = doc.lastAutoTable.finalY + 15;

    const addAmountLine = (label, amount, bold = false) => {
      const value = `Rs ${Number(amount).toLocaleString("en-IN", {
        minimumFractionDigits: 2,
      })}`;
      const labelX = 120;
      const valueX = doc.internal.pageSize.getWidth() - 20;

      doc.setFont(undefined, bold ? "bold" : "normal");
      doc.text(label, labelX, y);
      doc.text(value, valueX, y, { align: "right" });
      y += 8;
    };

    addAmountLine("Subtotal", itemsTotal);
    addAmountLine("Delivery", deliveryCharge);
    addAmountLine("Discount", discountAmount);

    otherCharges.forEach((c) => {
      if (c.label && Number(c.amount) !== 0) {
        addAmountLine(c.label, Number(c.amount));
      }
    });

    addAmountLine("Total", finalTotal, true);
    doc.save(`Habitus_Invoice_${order.orderId || "order"}.pdf`);
  };

  return (
    <div style={{ maxWidth: 900, margin: "2rem auto", padding: "2rem", background: "#1F2937", borderRadius: 12, color: "#fff" }}>
      <h2 style={{ fontSize: 28, marginBottom: "1.5rem", textAlign: "center" }}>Habitus Order Invoice Generator</h2>

      <div style={{ display: "flex", gap: 24, flexWrap: "wrap" }}>
        <div style={{ flex: 1, minWidth: 300 }}>
          <label>Order ID<br /><input name="orderId" value={order.orderId} onChange={handleOrderChange} className="input" /></label><br />
          <label>Name<br /><input name="name" value={order.name} onChange={handleOrderChange} className="input" /></label><br />
          <label>Address<br /><input name="address" value={order.address} onChange={handleOrderChange} className="input" /></label><br />
          <label>Phone<br /><input name="phone" value={order.phone} onChange={handleOrderChange} className="input" /></label>
        </div>
        <div style={{ flex: 1, minWidth: 300 }}>
          <label>Total Bill<br /><input value={finalTotal.toFixed(2)} disabled className="input" /></label><br />
          <label>Payment Mode<br /><input name="paymentMode" value={order.paymentMode} onChange={handleOrderChange} className="input" /></label><br />
          <label>PO Number<br /><input name="poNumber" value={order.poNumber} onChange={handleOrderChange} className="input" /></label>
        </div>
      </div>

      {/* Items */}
      <h3 style={{ marginTop: 32 }}>Items</h3>
      {items.map((item, i) => (
        <div key={i} style={{ display: "flex", gap: 8, marginBottom: 8, alignItems: "center" }}>
          <input name="description" placeholder="Description" value={item.description} onChange={(e) => handleItemChange(i, e)} className="input" style={{ flex: 2 }} />
          <input type="number" min={1} name="quantity" value={item.quantity} onChange={(e) => handleItemChange(i, e)} className="input" style={{ width: 80 }} />
          <input type="number" min={0} name="rate" value={item.rate} onChange={(e) => handleItemChange(i, e)} className="input" style={{ width: 80 }} />
          <span style={{ width: 80 }}>Rs {(item.quantity * item.rate).toFixed(2)}</span>
          <button onClick={() => removeItem(i)} disabled={items.length === 1} className="btn-danger">×</button>
        </div>
      ))}
      <button onClick={addItem} className="btn">+ Add Item</button>

      {/* Charges */}
      <h3 style={{ marginTop: 32 }}>Additional Charges</h3>
      {charges.map((charge, i) => (
        <div key={i} style={{ display: "flex", gap: 8, marginBottom: 8, alignItems: "center" }}>
          <input name="label" value={charge.label} onChange={(e) => handleChargeChange(i, e)} className="input" style={{ flex: 2 }} disabled={["delivery", "discount"].includes(charge.label.toLowerCase())} />
          <input type="number" min={0} name="amount" value={charge.amount} onChange={(e) => handleChargeChange(i, e)} className="input" style={{ width: 100 }} />
          <button onClick={() => removeCharge(i)} disabled={["delivery", "discount"].includes(charge.label.toLowerCase())} className="btn-danger">×</button>
        </div>
      ))}
      <button onClick={addCharge} className="btn">+ Add Charge</button>

      {/* Totals */}
      <div style={{ textAlign: "right", marginTop: 32 }}>
        <div style={{ fontSize: 16 }}>Subtotal: Rs {itemsTotal.toFixed(2)}</div>
        <div style={{ fontSize: 16 }}>Delivery: Rs {deliveryCharge.toFixed(2)}</div>
        <div style={{ fontSize: 16 }}>Discount: Rs {discountAmount.toFixed(2)}</div>
        <div style={{ fontSize: 20, fontWeight: "bold", marginTop: 10 }}>Total: Rs {finalTotal.toFixed(2)}</div>
      </div>

      <div style={{ textAlign: "center", marginTop: 40 }}>
        <button onClick={generatePDF} className="btn-large">📄 Generate PDF</button>
      </div>

      {/* Styles */}
      <style jsx>{`
        .input {
          padding: 8px 10px;
          border-radius: 6px;
          border: 1px solid #ccc;
          width: 100%;
          font-size: 14px;
          background: #fff;
          color: #000;
        }
        .btn {
          padding: 6px 12px;
          background: #2563eb;
          color: #fff;
          border: none;
          border-radius: 6px;
          cursor: pointer;
          font-size: 14px;
        }
        .btn-danger {
          padding: 4px 8px;
          background: #dc2626;
          color: #fff;
          border: none;
          border-radius: 6px;
          cursor: pointer;
        }
        .btn-large {
          padding: 12px 24px;
          font-size: 16px;
          background: #10b981;
          color: #fff;
          border: none;
          border-radius: 8px;
          cursor: pointer;
        }
      `}</style>
    </div>
  );
}
